import React,{useState,useEffect} from 'react'
import './StaffRoom.css'
import axios from 'axios'
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
function StaffRoom() {

    const[subject,setSubjects]=useState([])


    useEffect(() => {

      let  flag = true
       axios.get("http://localhost:3001/subjects", )
           .then((res) => {
               if (flag) {
                setSubjects(res.data);
               }
           })


       return () => flag = false
   }, [])
    return (
        <div className='staffroom'>

        <div className="staffroom__action">
            <div className="staffroom__box">
                <h3>Computer Skills</h3>
                  <div className="staffroom__subject">
                    <h4>Activity</h4>
                    <input type="number" />
                    <button type="submit">Add</button>
                  </div>
                  <div className="staffroom__subject">
                    <h4>Quiz</h4>
                    <input type="number" />
                    <button type="submit">Add</button>
                  </div>
                  <div className="staffroom__subject">
                    <h4>Midterm</h4>
                    <input type="number" />
                    <button type="submit">Add</button>
                  </div>
                  <div className="staffroom__subject">
                    <h4>Final</h4>
                    <input type="number" />
                    <button type="submit">Add</button>
                  </div>

            </div>
        </div>


            {subject.map((item,i)=>{
                return(

            <div key={item._id}>
                <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel2a-content"
          id="panel2a-header"
        >
          <Typography>{item.subject} {i}</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse
            malesuada lacus ex, sit amet blandit leo lobortis eget.
          </Typography>
        </AccordionDetails>
      </Accordion>
            </div>


                )
            })}

        </div>
    )
}

export default StaffRoom
